import React from 'react';
import EMRImg from "../../images/EMR-img.svg";
import Card from "./Card";
import EMRImg1 from "../../images/EMR-img-1.svg"
import EMRImg2 from "../../images/EMR-img-2.svg"
import EMRImg3 from "../../images/EMR-img-3.svg"

function EMR() {

    const cardTitle1 = "Intuitive Interface";
    const cardTitle2 = "Workflow Automations";
    const cardTitle3 = "Telehealth Ecosystem";

    const cardText1 = "Designed to fit with the natural progression of decision making.";
    const cardText2 = "Predicts treatment plans, prescriptions, billing codes and more.";
    const cardText3 = "";


    return (
        <div className="EMR">
        <div className="EMR-container">
            <h2>Bring the next generation of EMRs <br></br> to your  Urgent Care practice</h2>
            <div className="EMR-content">
                <img src={EMRImg} className="EMRimg" alt="EMR img"></img>
                <div className="cards-container">
                    <Card image={EMRImg1} title={cardTitle1} text={cardText1} />
                    <Card image={EMRImg2} title={cardTitle1} text={cardText1} />
                    <Card image={EMRImg3} title={cardTitle1} text={cardText1} />
                </div>
            </div>
        </div>
        </div>
    )
}

export default EMR;
